import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';

const AdminNavbar = () => {
  return (
    <Navbar bg="light" expand="lg" className="mb-4">
      <Container>
        <Navbar.Brand as={Link} to="/admin">Kings Portal (Admin)</Navbar.Brand>
        <Navbar.Toggle aria-controls="admin-navbar-nav" />
        <Navbar.Collapse id="admin-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/admin">Home</Nav.Link>
            <Nav.Link as={Link} to="/admin/pending">Pending Approval</Nav.Link>
            <Nav.Link as={Link} to="/admin/assets">Show Asset</Nav.Link>
            <NavDropdown title="Maintenance" id="maintenance-dropdown">
              <NavDropdown.Item as={Link} to="/admin/maintenance/ongoing">Ongoing</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/admin/maintenance/upcoming">Upcoming</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link as={Link} to="/admin/assign-task">Assign Task</Nav.Link>
            <Nav.Link as={Link} to="/admin/assessments">All Assessment</Nav.Link>
          </Nav>
          <Nav className="ms-auto">
            <Nav.Link as={Link} to="/login">Login</Nav.Link>
            <Nav.Link as={Link} to="/signup">Signup</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default AdminNavbar;
